/*Table structure for table `service_category` */

DROP TABLE IF EXISTS `service_category`;

CREATE TABLE `service_category` (
  `subcategoryId` int(11) NOT NULL auto_increment,
  `categoryId` int(11) default NULL,
  `service` varchar(50) default NULL,
  `type` varchar(50) default NULL,
  PRIMARY KEY  (`subcategoryId`),
  KEY `FK_service_category` (`categoryId`),
  CONSTRAINT `FK_service_category` FOREIGN KEY (`categoryId`) REFERENCES `category_master` (`categoryId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `service_category` */

insert  into `service_category`(`subcategoryId`,`categoryId`,`service`,`type`) values (1,1,'vegetable','static'),(2,1,'vegetable','mobile'),(3,2,'Mobile Phones','static'),(4,3,'Bata','static'),(5,3,'Woodland','static'),(6,5,'Book Shop','static'),(7,6,'Dentist','static');

/*Table structure for table `sp_master` */

DROP TABLE IF EXISTS `sp_master`;

CREATE TABLE `sp_master` (
  `sno` int(6) NOT NULL auto_increment,
  `spId` int(6) default NULL,
  `latitude` double default NULL,
  `longitude` double default NULL,
  PRIMARY KEY  (`sno`),
  KEY `FK_sp_master` (`spId`),
  CONSTRAINT `FK_sp_master` FOREIGN KEY (`spId`) REFERENCES `registration_master` (`spId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `sp_master` */

insert  into `sp_master`(`sno`,`spId`,`latitude`,`longitude`) values (1,1,22.7628003,75.8824259),(2,2,22.7156564,75.8966003),(3,3,22.7326607,75.8907418),(4,4,22.7453955,75.8717054),(5,5,22.7318948,75.890792),(6,6,22.7318948,75.890792),(7,9,22.7367662,75.9085792),(8,10,22.7570623,75.8821865),(9,11,22.7326607,75.8907418),(11,13,22.7081457,75.922958);

/*Table structure for table `sp_rating` */

DROP TABLE IF EXISTS `sp_rating`;

CREATE TABLE `sp_rating` (
  `ratingId` int(10) NOT NULL auto_increment,
  `spId` int(10) default NULL,
  PRIMARY KEY  (`ratingId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `sp_rating` */

insert  into `sp_rating`(`ratingId`,`spId`) values (0,NULL);

/*Table structure for table `sp_review` */

DROP TABLE IF EXISTS `sp_review`;

CREATE TABLE `sp_review` (
  `reviewId` int(11) NOT NULL auto_increment,
  `spId` int(11) default NULL,
  `review` varchar(1000) default NULL,
  PRIMARY KEY  (`reviewId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

